import React from 'react';

const AboutUs: React.FC = () => {
  return (
    <section className="py-16">
      <div className="flex justify-between items-start">
        <div className="max-w-[440px]">
          <h2 className="font-clash-display font-semibold text-section-heading text-design-black leading-[0.93em] mb-8">
            About Us
          </h2>
          <p className="font-satoshi font-normal text-subheading text-design-black leading-[1.16em]">
            Nicsan Insurance is an Organically grown business by two simple people from simple beginnings.
          </p>
        </div>
        
        {/* Red NICSAN text on the right */}
        <div className="flex-shrink-0 ml-8">
          <h1 className="text-red-600 font-bold text-2xl tracking-wider">
            NICSAN
          </h1>
        </div>
      </div>
    </section>
  );
};

export default AboutUs;
